import UIKit

open class IntentionsRouter: IntentionsWireframeProtocol {
    
    weak var viewController: UIViewController?
    
    static public func createModule() -> UIViewController {
        let view = IntentionsViewController(nibName: "IntentionsViewController", bundle: Bundle.init(identifier: "mx.arquidiocesis.EncuentroCatolicoServices"))
        
        let interactor = IntentionsInteractor()
        let router = IntentionsRouter()
        let presenter = IntentionsPresenter(interface: view, interactor: interactor, router: router)
        
        view.presenter = presenter
        interactor.presenter = presenter
        router.viewController = view
        
        return view
    }
}
